import { Fragment } from "react";
import classes from "./Card.module.css";

const Card = (props) => {
  return (
    <Fragment>
      <div className={`${classes.card} ${props.className}`}>
        {props.children}
      </div>
    </Fragment>
  );
};

export default Card;
